import * as React from "react";
import Paper from "@mui/material/Paper";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TablePagination from "@mui/material/TablePagination";
import TableRow from "@mui/material/TableRow";

const columns = [
  { id: "shift", label: "Shift", minWidth: 100 },
  { id: "start", label: "Start Date", minWidth: 170 },
  {
    id: "end",
    label: "End Date",
    minWidth: 170
  },
  {
    id: "certification",
    label: "Qualification Required",
    minWidth: 170
  },
  {
    id: "nurse",
    label: "Nurse Assigned",
    minWidth: 170
  },
];

function createData(
  shift,
  start,
  end,
  nurse,
  certification
) {
  return { shift, start, end, nurse, certification };
}

const rows = [
  createData(
    "MedSurg 1",
    "2022-12-01T00:00:00Z",
    "2022-12-01T04:00:00Z",
    "Del Hatchell",
    "LPN"
  ),
  createData(
    "MedSurg 2",
    "2022-12-02T00:00:00Z",
    "2022-12-02T04:00:00Z",
    "Mitchell Bagnall",
    "RN"
  ),
  createData(
    "MedSurg 3",
    "2022-12-02T00:00:00Z",
    "2022-12-02T04:00:00Z",
    "Tom Baxter",
    "RN"
  ),
  createData(
    "MedSurg 4",
    "2022-12-02T00:00:00Z",
    "2022-12-02T04:00:00Z",
    "Tim Horton",
    "RN"
  ),
  createData(
    "MedSurg 5",
    "2022-12-02T00:00:00Z",
    "2022-12-02T04:00:00Z",
    "Dave Jennings",
    "LPN"
  ),
  createData(
    "MedSurg 5",
    "2022-12-02T00:00:00Z",
    "2022-12-02T04:00:00Z",
    "Dave Jennings",
    "LPN"
  ),
  createData(
    "MedSurg 5",
    "2022-12-02T00:00:00Z",
    "2022-12-02T04:00:00Z",
    "Dave Jennings",
    "LPN"
  ),
  createData(
    "MedSurg 5",
    "2022-12-02T00:00:00Z",
    "2022-12-02T04:00:00Z",
    "Dave Jennings",
    "LPN"
  ),
  createData(
    "MedSurg 5",
    "2022-12-02T00:00:00Z",
    "2022-12-02T04:00:00Z",
    "Dave Jennings",
    "LPN"
  ),
  createData(
    "MedSurg 5",
    "2022-12-02T00:00:00Z",
    "2022-12-02T04:00:00Z",
    "Dave Jennings",
    "LPN"
  ),
  createData(
    "MedSurg 5",
    "2022-12-02T00:00:00Z",
    "2022-12-02T04:00:00Z",
    "Dave Jennings",
    "LPN"
  ),
  createData(
    "MedSurg 5",
    "2022-12-02T00:00:00Z",
    "2022-12-02T04:00:00Z",
    "Dave Jennings",
    "LPN"
  ),
];

export default function ShiftsListControl() {
  const [page, setPage] = React.useState(0);
  const [rowsPerPage, setRowsPerPage] = React.useState(10);
  const [shiftsList, setShiftsList] = React.useState([]);

  React.useEffect(()=> {
    fetchShifts();
  }, []);

  const fetchShifts = () => {
        fetch("http://localhost:9001/shifts", {
          mode: "cors",
          headers: {
            "Content-Type": "application/json",
            Accept: "application/json",
          },
        })
          .then((response) => response.json())
          .then((res) => this.setShiftsList(res))
          .catch((reason) => console.log(reason));
  }

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = (event) => {
    setRowsPerPage(+event.target.value);
    setPage(0);
  };

  return (
    <Paper sx={{ width: "100%", overflow: "hidden" }}>
      <TableContainer sx={{ maxHeight: 440 }}>
        <Table stickyHeader aria-label="sticky table">
          <TableHead>
            <TableRow>
              {columns.map((column) => (
                <TableCell
                  key={column.id}
                  align={column.align}
                  style={{ minWidth: column.minWidth }}
                >
                  {column.label}
                </TableCell>
              ))}
            </TableRow>
          </TableHead>
          <TableBody>
            {shiftsList
              .slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
              .map((shift) => {
                return (
                  <TableRow hover role="checkbox" tabIndex={-1} key={shift.id}>
                    {columns.map((column) => {
                      const value = shift[column.id];
                      return (
                        <TableCell key={column.id} align={column.align}>
                          {column.format && typeof value === "number"
                            ? column.format(value)
                            : value}
                        </TableCell>
                      );
                    })}
                  </TableRow>
                );
              })}
          </TableBody>
        </Table>
      </TableContainer>
      <TablePagination
        rowsPerPageOptions={[10, 25, 100]}
        component="div"
        count={this.state.shifts.length}
        rowsPerPage={rowsPerPage}
        page={page}
        onPageChange={handleChangePage}
        onRowsPerPageChange={handleChangeRowsPerPage}
      />
    </Paper>
  );
}
